import React from "react";
import { Track } from "../api/track/models/Track";
import { TrackItem } from "./TrackItem";
import { Box, Typography } from "@mui/material";
import { PageList } from "../types/PageList";
import { TrackListItem } from "./TrackListItem";

interface Props {
  tracks: PageList<Track> | undefined;
  onTrackDelete: (trackId: string) => void;
}

export const TrackList: React.FC<Props> = ({ tracks, onTrackDelete }) => {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        width: "100%",
        padding: 3,
        maxWidth: 900,
        margin: "0 auto",
        // justifyContent: "center",
        // alignItems: "center",
        gap: "20px",
      }}
    >
      <Typography variant="h4">List of Tracks</Typography>
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          gap: "10px",
        }}
      >
        {tracks?.data.map((track) => (
          <TrackListItem
            key={track.id}
            track={track}
            onDelete={onTrackDelete}
          />
        ))}
        {/* {tracks?.data[0] && (
          <TrackItem
            key={tracks?.data[0].id}
            track={tracks?.data[0]}
            onDelete={onTrackDelete}
          />
        )} */}
      </Box>
    </Box>
    // <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
    //   {tracks.map((track) => (
    //     <TrackItem key={track.id} track={track} onDelete={onTrackDelete} />
    //   ))}
    // </div>
  );
};
